   [63]={next_id=64, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="正是如此。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [64]={next_id=65, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="环星列车每天一共发出两趟，从宣布运营开始的那天算起，离运行满一个月只剩最后一天。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [65]={next_id=66, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="一个月后，它不再是维拉提亚的主角，那时，维拉提亚将会举行首次向世界开放的骑士选拔大会和星征巡礼。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [66]={next_id=67, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="你和辉月在的，就是环星列车暂停运营前的最后一趟。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [67]={next_id=68, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="除去需要预约的优渥车厢和包间，所有列座车厢的座位全部坐满，甚至有站着的观光客——整趟列车的总人数已经严重超过定员数量。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [68]={next_id=69, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="这些人里来有自各国的政客，商业家，也有维拉提亚的本地人……这一趟列车的载客几乎来自泰诺星每个有名字的要塞都市。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [69]={next_id=70, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="——你大概理解事情的严重性了。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [70]={next_id=71, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="你所说的极端分子，就混在里面。", msg_color="", msg_size=0, talker="玩家名字", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [71]={next_id=72, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="（点头）这些人的阴谋从未成功过，因此这是最后一次机会，他们一定会选择最直接，最疯狂的方式。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [72]={next_id=73, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="骑士团的情报只指向了环星列车，即便经过了仔细排查，也很难将隐患根除。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [73]={next_id=74, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="最大的困难则是……", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [74]={next_id=75, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="蒂雅叹了口气，靠近了你一些，压低了声音。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,0}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [75]={next_id=76, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="现在的骑士团，没有足够的人手能处理这一次几乎是摆在明面上的危机。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [76]={next_id=77, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="环星列车不能停下来，这关乎到维拉提亚第一次向世界展现的脸面，无论是唤星院还是教皇厅，都希望最后一趟环星列车能圆满回到星都。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [77]={next_id=78, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="骑士团如今只剩下三名命星骑士，而我和烁曦还有同样急需去解决的问题……只有辉月能登上列车。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [78]={next_id=79, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="辉月的能力我并不怀疑，但我们不知道极端分子手段何如，我必须考虑到最坏的可能。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [79]={next_id=80, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="眼下，只有你和你的伙伴我能完全相信，链尉官。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
