   [81]={next_id=82, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="想必你在莱斯坦斯时有很多疑惑，因为这是维拉提亚自己的问题，本不应该涉及到你们，我必须尽可能地保密。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [82]={next_id=83, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="所以，这是一次私人请求，链尉官。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [83]={next_id=84, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="我代表护星骑士团，向你正式发出求助。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [84]={next_id=85, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="请你协助辉月……协助骑士团，渡过这次危机，让环星列车圆满地回到星都。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [85]={next_id=86, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="蒂雅向着你颔首低眉说道，你有些惊讶这位以自信和镇静而闻名的代理骑士长居然会主动低下身份。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [86]={next_id=87, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="但你心理已经清楚自己要做什么，蒂雅对你毫无保留，你更加没有理由拒绝她。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [87]={next_id=88, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="你伸出手，将战术目镜摘下，同样抱以诚挚地回应她。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
